import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          Intro to ReactJs 
          <a href="https://reactjs.org/docs/create-a-new-react-app.html">Reference Website</a>
      </header>
    </div>
  );
}

export default App;
